import React from "react";
import {
  ContentMenuHiden,
  HeaderContainer,
  Menubar,
  MenuHidenContainer,
  OpacityContainer,
} from "../Header/style";
import { LOGOBGContainer } from "../Logo/style";
import Logo from "../Logo/index";

function Index() {
  return (
    <>
      <HeaderContainer>
        {/** Responsive by service have sreen from  900px to > 1200px*/}
        <Menubar />
        <OpacityContainer />
        <MenuHidenContainer>
          <ContentMenuHiden>
            <LOGOBGContainer>
              <Logo />
            </LOGOBGContainer>
          </ContentMenuHiden>
        </MenuHidenContainer>
      </HeaderContainer>
    </>
  );
}

export default Index;
